import logo from './logo.svg';
import './App.css';

function Tavinho() {
  return (
    <div className="Tavinho">
      <header className="Tavinho-header">
        <img src={logo} className="Tavinho-logo" alt="logo" />
        <p>
          <p>Eu sou um component</p>
        </p>
      </header>
    </div>
  );
}

export default Tavinho;
